import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Navbar from '../components/navbar'; // Updated to match file case

const MainPage = () => {
  const navigate = useNavigate();
  const [profile, setProfile] = useState({
    username: 'JohnDoe',
    email: 'johndoe@example.com',
    password: 'password123',
  });

  const handleProfileChange = (field, value) => {
    setProfile({
      ...profile,
      [field]: value,
    });
  };

  return (
    <div>
      {/* Render the Navbar */}
      <Navbar />

      {/* Profile Section */}
      <div className="profile" style={{ marginTop: '70px' }}>
        <h2>Profile</h2>
        <div>
          <label>Username: </label>
          <input
            type="text"
            value={profile.username}
            onChange={(e) => handleProfileChange('username', e.target.value)}
          />
        </div>
        <div>
          <label>Email: </label>
          <input
            type="email"
            value={profile.email}
            onChange={(e) => handleProfileChange('email', e.target.value)}
          />
        </div>
        <div>
          <label>Password: </label>
          <input
            type="password"
            value={profile.password}
            onChange={(e) => handleProfileChange('password', e.target.value)}
          />
        </div>
        <button onClick={() => alert('Profile updated!')}>Save Changes</button>
      </div>

      {/* Main Content */}
      <div className="content">
        <h1>Welcome to our website!</h1>
        <p>
          Here, you'll find a variety of services including lost & found, user
          profiles, and much more!
        </p>
      </div>
    </div>
  );
};

export default MainPage;
